import React from 'react';
import classes from './Employee.module.css';
const Employee = (props) => {
 const EmployListProcessed = props.data.map(employee => {
  return (
   <>
    <div className={classes.BoxFlex}>
     <div key={employee.id} className={classes.Employee}>
      <div className={classes.Rounded}>  <img src={employee.avatar} /></div>
      <h2> {employee.first_name}</h2>
      <h2>{"B00" + employee.id}</h2>
      <p>Email: {employee.email}</p>
     </div>
    </div>
   </>
  )
 })
 return (
  <>
   <div className={classes.EmployeesWrapper}>
    {EmployListProcessed}

   </div>
  </>
 )
}

export default Employee;
